import React from "react";
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";
import Home from "./Home";
import AddCart from "./Cart"

function App(){
  return(
    <div>
      <Router>
        <Routes>
          <Route path="/" Component={Home}/>
          <Route path="/cart" Component={AddCart}/>
        </Routes>
      </Router>
    </div>
  )
}

export default App;
